import React from 'react'

const Clothing = ({products}) => {
    const clothingProducts = products.map(prod => prod)

    const filteredClothing = clothingProducts.category.filter((product) => {
        return product.category.includes("clothing")
    })

    return (
    <div>
        {filteredClothing} 
    </div>
    )
}
export default Clothing
